import React, { useEffect } from "react";
import {
  View,
  ScrollView,
  Text,
  Dimensions,
  KeyboardAvoidingView,
  Platform,
  Pressable,
  TouchableOpacity,
  ActivityIndicator,
  Alert,
} from "react-native";
import { SvgXml } from "react-native-svg";
import Input from "../../components/Input";
import TextArea from "../../components/TextArea";
import { AntDesign } from "@expo/vector-icons";
import { createMaterialTopTabNavigator } from "@react-navigation/material-top-tabs";
const { width, height } = Dimensions.get("window");
const Tab = createMaterialTopTabNavigator();
import Animated from "react-native-reanimated";
import IconButton from "../../components/IconButton";
import { CheckBox } from "../Seller/Pricing";
import uuid from "react-native-uuid";
import { ImageButton } from "../Seller/Service";
import { uploadFile } from "../../Class/upload";
import { fileFromURL } from "../../action";
import { useDispatch, useSelector } from "react-redux";
import { Entypo } from "@expo/vector-icons";
import { createOtherService, createService, getService } from "../../Class/service";
import { Menu } from "react-native-paper";
import { useIsFocused } from "@react-navigation/native";
import { localOptionsToServer } from "../../Class/dataConverter";
import { SafeAreaView } from "react-native-safe-area-context";
import { updateGigsData } from "../../Class/update";
import { setHideBottomBar } from "../../Reducers/hideBottomBar";

export default function EditPackageService({ navigation, route }) {
  const [Package, setPackage] = React.useState([]);
  const [Title, setTitle] = React.useState();
  const [Description, setDescription] = React.useState();
  const [Images1, setImage1] = React.useState();
  const [Image2, setImage2] = React.useState();
  const [Image3, setImage3] = React.useState();
  const [Image4, setImage4] = React.useState();
  const [ImageError, setImageError] = React.useState();
  const [TitleError, setTitleError] = React.useState();
  const [DescriptionError, setDescriptionError] = React.useState();
  const user = useSelector((state) => state.user);
  const vendor = useSelector((state) => state.vendor);
  const businessForm = useSelector((state) => state.businessForm);
  const listData = useSelector((state) => state.listData);
  const [Loader, setLoader] = React.useState(false);
  const packages = useSelector((state) => state.packages);
  const [PackageError, setPackageError] = React.useState();
  const isFocused = useIsFocused();
  const dispatch = useDispatch();
  const [Height, setHeight] = React.useState(4);
  const length=route.params&&route.params.length?route.params.length:null;
  const params=route.params;
  const [serverData,setServerData]=React.useState()
  const gigs=params.gigs;

  React.useEffect(() => {
    if (isFocused) {
      //console.log("hidden")
      dispatch(setHideBottomBar(true));
      setTimeout(() => {
        dispatch(setHideBottomBar(true));
      }, 50);
    } else {
      //console.log("seen")
      dispatch(setHideBottomBar(false));
    }
  }, [isFocused]);
  useEffect(()=>{
    if(gigs){
        setImage1({uri:gigs.images[0]})
        setImage2({uri:gigs.images[1]})
        setImage3({uri:gigs.images[2]})
        setImage4({uri:gigs.images[3]})
        setTitle(gigs.title)
        setDescription(gigs.description)
        dispatch({ type: "SET_PACKAGES", playload: gigs.packageData });
    }
  },[gigs.id])
  
  const updateData = async () => {
    if(!Images1||!Image2||!Image4||!Image3){
      setImageError("*Please upload all four images")
      return
    }
    if(!Title){
      setTitleError("*Please add title")
      return
    }
    if(packages.length<2){
      setPackageError("*Please add minimum 2 packages")
      return
    }
    setLoader(true);
    if(Images1.type){
      let arr=[]
      arr.push(fileFromURL(Images1))
      const res=await uploadFile(arr,user.token);
      setImage1({uri:res[0]})
    }
    if(Image2.type){
      let arr=[]
      arr.push(fileFromURL(Image2))
      const res=await uploadFile(arr,user.token);
      setImage2({uri:res[0]})
    }
    if(Image3.type){
      let arr=[]
      arr.push(fileFromURL(Image3))
      const res=await uploadFile(arr,user.token);
      setImage3({uri:res[0]})
    }
    if(Image4.type){
      let arr=[]
      arr.push(fileFromURL(Image4))
      const res=await uploadFile(arr,user.token);
      setImage4({uri:res[0]})
    }
    let images=[];
    images.push(Images1.uri)
    images.push(Image2.uri)
    images.push(Image3.uri)
    images.push(Image4.uri)
    updateGigsData(user.token,{
      gigId:gigs.id,
      title:Title,
      description:Description,
      price:0,
      images:images,
      packageData:packages
    }).then(res=>{
      updateVendorInfo()
    }).catch(err=>{
      setLoader(false)
      console.error(err.response.data.msg)
    })
  };
  const updateVendorInfo=async()=>{
    const res=await getService(user.token,vendor.service.id);
    if(res){
      setLoader(false)
      dispatch({ type: "SET_VENDOR", playload: res.data });
      navigation.navigate("VendorProfile");
    }
  }
  const deleteData = async (id) => {
    setLoader(true);
    await dispatch({ type: "DELETE_PACKAGE", playload: id });
    setLoader(false);
  };
  React.useEffect(()=>{
    if(params&&params.data){
      setServerData(params.data)
    }
  },[])
  React.useEffect(() => {
    //setLoader(true)
    let max = 0;
    packages &&
      packages.map((doc, i) => {
        if (max < doc.features.length) {
          max = doc.features.length;
        }
      });
      if(max<4){
        setHeight(4);
        return
      }
      setHeight(max);
      //setLoader(false)
  }, [packages.length+length]);
  

  if (Loader|| !isFocused ||packages.length==0) {
    return (
      <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
        <ActivityIndicator color={"red"} size="small" />
      </View>
    );
  }

  return (
    <KeyboardAvoidingView
      style={{ flex: 1 }}
      behavior={Platform.OS === "ios" ? "padding" : null}
      keyboardVerticalOffset={Platform.OS === "ios" ? 100 : 0}
    >
      <SafeAreaView style={{flex:1}}>
      
      <ScrollView showsVerticalScrollIndicator={false}>
        <View
          style={{
            flexDirection: "row",
            paddingHorizontal: 20,
            marginTop: 0,
          }}
        >
          <View
            style={{
              flex: 1,
            }}
          >
            <SvgXml xml={circle} height="13" width={"13"} />
            <Text
              style={{
                fontSize: 20,
                fontFamily: "Poppins-SemiBold",
                marginTop: 10,
                
              }}
            >
              Add Your Best Package Service
            </Text>
          </View>
          <SvgXml
            xml={vectorImage}
            style={{
              flex: 2,
            }}
            height={width / 2 + 35}
            width={width / 2 + 35}
          />
        </View>
        <View
          style={{
            paddingHorizontal: 20,
          }}
        >
          <Input
            error={TitleError}
            value={Title}
            onChange={(e) => setTitle(e)}
            style={{
              borderWidth: 1,
              marginHorizontal: 0,
            }}
            placeholder={"Service Title"}
          />
        </View>
        <View
          style={{
            marginHorizontal: 20,
            marginBottom: 10,
          }}
        >
          <TextArea
            error={DescriptionError}
            value={Description}
            onChange={(e) => setDescription(e)}
            style={{
              marginTop: 15,
            }}
            placeholder={"Description"}
          />
        </View>
        <View
          style={{
            flexDirection: "row",
            paddingHorizontal: 20,
            marginBottom: 15,
            marginTop: 10,
          }}
        >
          <Text
            style={{
              fontSize: 18,
              fontFamily: "Poppins-SemiBold",
            }}
          >
            Add Package
          </Text>
          <View
            style={{
              flex: 1,
              marginLeft: 50,
              justifyContent: "center",
            }}
          >
            <Text
              style={{
                fontSize: 12,
                textAlign: "justify",
              }}
            >
              *minimum Two package and maximum 5 package can add
            </Text>
          </View>
        </View>
        
         {Height?(
           <View
           style={{
             height: Height * 60,
           }}
         >
           <Tab.Navigator initialRouteName={packages.length==0?"Add Package":packages[packages.length-1].id}
            
             tabBar={(props) => (
               <TabBar
                 onClick={(e) => {
                   //console.log(e)
                   navigation.navigate("EditPackageScreen", {
                     setPackage: setPackage,
                     data: packages.filter((d) => e.id == d.id)[0],
                     package: packages,
                     gigs:gigs,
                   });
                 }}
                 onPress={(e) => {
                   Alert.alert("Hey!", "Are you want to delete this?", [
                     {
                       text: "Cancel",
                       onPress: () => console.log("Cancel Pressed"),
                       style: "cancel",
                     },
                     {
                       text: "OK",
                       onPress: () => {
                         deleteData(e);
                       },
                     },
                   ]);
                 }}
                 {...props}
               />
             )}
             screenOptions={{
               lazy: true,
               lazyPreloadDistance: 100,
             }}
           >
             {packages.map((doc, i) => (
               <Tab.Screen
                 initialParams={{ data: doc }}
                 key={i}
                 name={doc.id}
                 component={TabScreen}
               />
             ))}

             {packages.length < 5 && (
               <Tab.Screen
                 name="Add Package"
                 initialParams={{ setPackage: setPackage,gigs:gigs }}
                 component={Screen}
               />
             )}
           </Tab.Navigator>
         </View>
         ):(<></>)}
        
        {PackageError && (
          <Text
            style={{
              marginHorizontal: 20,
              color: "red",
              marginVertical: 10,
            }}
          >
            {PackageError}
          </Text>
        )}
        <View
          style={{
            paddingHorizontal: 20,
            flexDirection: "row",
            alignItems: "center",
            justifyContent: "space-between",
          }}
        >
          <Text
            style={{
              fontSize: 16,
              fontFamily: "Poppins-Medium",
            }}
          >
            Add Photo
          </Text>
          <Text
            style={{
              fontSize: 10,
              fontFamily: "Poppins-Medium",
            }}
          >
            *maximum 2 mb size
          </Text>
        </View>
        <View
          style={{
            flexDirection: "row",
            paddingHorizontal: 20,
            justifyContent: "space-between",
            marginTop: 20,
          }}
        >
          <ImageButton
            value={Images1}
            onChange={(e) => {
              setImage1(e);
            }}
          />
          <ImageButton
            value={Image2}
            onChange={(e) => {
              setImage2(e);
            }}
          />
          <ImageButton
            value={Image3}
            onChange={(e) => {
              setImage3(e);
            }}
          />
          <ImageButton
            value={Image4}
            onChange={(e) => {
              setImage4(e);
            }}
          />
        </View>
        {ImageError && (
          <Text
            style={{
              color: "red",
              marginHorizontal: 20,
            }}
          >
            {ImageError}
          </Text>
        )}
        <View
          style={{
            height: 20,
          }}
        />
        <IconButton
          onPress={updateData}
          style={{
            backgroundColor: "#4ADE80",
            marginHorizontal: 20,
            height: 35,
            borderWidth: 0,
          }}
          title={"Update"}
        />
        <View
          style={{
            height: 20,
          }}
        />
      </ScrollView>
      </SafeAreaView>
    </KeyboardAvoidingView>
  );
}
const Screen = ({ navigation, route }) => {
  const setPackage =
    route.params && route.params.setPackage ? route.params.setPackage : null;
    const gigs=route.params.gigs;
  return (
    <View
      style={{
        flex: 1,
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      {route.name == "Add Package" && (
        <IconButton
          onPress={() => {
            navigation.navigate("EditPackageScreen", {
              setPackage: setPackage,
              gigs:gigs
            });
          }}
          Icon={() => <SvgXml xml={rightIcon} height="15" width="15" />}
          style={{
            borderColor: "#E2E2E2",
            borderWidth: 0.5,
            width: 120,
            alignSelf: "center",
            justifySelf: "center",
          }}
          title={"Add Now"}
        />
      )}
    </View>
  );
};
const TabScreen = ({ navigation, route }) => {
  const data = route.params.data;

  return (
    <View
      style={{
        flex: 1,
      }}
    >
      {data.features.map((doc, i) => (
        <View
          style={{
            flexDirection: "row",
            marginHorizontal: 20,
            justifyContent: "space-between",
            marginVertical: 5,
            borderBottomColor: "#F1F1F1",
            borderBottomWidth: data.features.length - 1 == i ? 0 : 1,
          }}
          key={i}
        >
          <View style={{flex:1}}>
            {doc.isAvailable ? (
              <SvgXml xml={right} height="30" width={"30"} />
            ) : (
              <Entypo
                style={{
                  marginBottom: 8,
                }}
                name="cross"
                size={20}
                color="red"
              />
            )}
          </View>
          <View style={{
            flex:1,
            alignItems:"flex-end"
          }}>
            <Text
              style={{
                fontSize: 14,
                color: "#666666",
                textAlign:"justify"
              }}
            >
              {doc.title ? doc.title : ""}
            </Text>
          </View>
        </View>
      ))}
    </View>
  );
};
